  blueprint_courses_must_be_enabled_for_an_account_b_2193151: "Administratören måste aktivera blueprint-kurser i ett konto. Kursroller kan endast hantera blueprint-kursinnehåll om de läggs till i blueprint-kursen med lärar-, TA- eller designerroll. Även om den här behörigheten är inaktiverad kan en användare ändå justera låsinställningar för innehåll på enskilda sidor i en blueprint-huvudkurs."
