        eportfolio_name: "Min portfolio"
      headers: 
        add_eportfolio: "Skapa en ePortfolio"
        eportfolios: ePortfolios
        my_eportfolios: "Mina ePortfolios"
        what: "Vad är en ePortfolio?"
      labels: 
        eportfolio_name: "ePortfolions namn"
        make_public: "Gör den offentlig"
      links: 
        create: "Skapa en ePortfolio"
      page_title: "Mina ePortfolios"
      what: 
        details1: |-
            ePortfolios är en plats där du kan visa och diskutera viktiga
            inlämningar och erfarenheter under inlärningsprocessen.
             Du kan använda en ePortfolio till att: 
            
            * Visa upp de uppsatser som du är stolt över för fler personer än bara läraren
            *. Dela dina tankar och det arbete du lagt ner på dina inlämningar
            * Får en översikt över dina inlärningsupplevelser
            * Dela dina arbeten med vänner, framtida arbetsgivare, m.m.
            
            ePortfolios kan vara offentliga för alla, eller privata så att endast
            utvalda kan se dem. Du kan ändra den inställningen när du vill.
            
            Är du redo att komma igång? Klicka på knappen.
    wizard_box: 
      finish: 
        body: "Är du redo att sätta igång? Du kan alltid återkomma till den här guiden från vilken sida som helst genom att klicka på länken ”%{help_link_text}” som länken du ser här."
      headers: 
        finish: "Då kör vi"
        getting_started: "Komma igång"
        instructions: "Använda en ePortfolio"
        introduction: Introduktion
        page_content: Sidinnehåll
        pages: Sektionssidor
        sections: Portfolio-sektioner
        settings: ePortfolio-inställningar
        submissions: "Lägga till inlämningar"
      introduction: 
        body: "ePortfolios är en plats där du kan visa ditt arbete. De består av sektioner och sidor. Listan med sektioner är placerad till väster i fönstret (%{showme1}). Varje sektion kan ha flera sidor, sidorna visas till höger i fönstret (%{showme2})."
      links: 
        portfolio: "Visa portfolion"
      page_content: 
        body1: "Innehållet du ser på en sida är samma innehåll som alla besökare ser. Redigera innehållet genom att klicka på länken ”%{edit_link_text}”  (%{showme}) så ändras sidan till redigeringsläget."
        body2: "Nu kan du redigera! Du kan ändra namn på sidan eller kommentarsalternativen (%{showme1}) om du vill. Du kan spara, förhandsgranska eller avbryta dina ändringar när du vill genom att klicka på knappen till höger (%{showme2})."
        body3: "Innehållet är uppdelat i undersektioner, varje undersektion har en prickad avgränsning. Du kan radera eller redigera innehållet i alla undersektioner genom att klicka på ikonerna %{edit_icon} eller %{delete_icon} längst upp till höger."
        body4: "För att lägga till nya undersektioner måste du hitta och klicka på det innehåll du vill lägga till. Det gör du i alternativlistan till höger på sidan (%{showme})."
      pages: 
        body1: "Sektioner har flera sidor. Du kan se en lista över sidorna i den nuvarande sektionen till höger i fönstret (%{showme1}). Organisera eller lägg till sidor genom att klicka på länken ”%{manage_pages}” (%{showme2})."
        body2: "Du kan ändra namn på sidor genom att klicka på ikonen %{edit_icon}, radera sidor genom att klicka på ikonen %{delete_icon}, eller ordna om sidor genom att klicka och dra dem."
      sections: 
        body1: "En lista med sektioner finns till vänster i fönstret (%{showme1}). Varje sektion kan ha flera sidor i sig. Organisera eller lägg till sektioner genom att klicka på länken ”%{manage_sections}” (%{showme2})."
        body2: "Du kan döpa om alla sektioner genom att klicka på ikonen %{edit_icon}, ordna om sektionerna genom att klicka och dra dem, eller radera sektioner genom att klicka på ikonen %{delete_icon}."
      settings: 
        body: "Ändra ePortfolions inställningar genom att klicka på länken ”ePortfolio-inställningar” (%{showme}). Du kan ändra namn på portfolion och ändra om den är privat eller offentlig. Privata portfolios är endast tillgängliga för de som du har gett åtkomst till."
      submissions: 
        body1: "Du har kanske märkt att det längst ner på sidan finns en lista med nya inlämningar från dina klasser (%{showme}). Från den här sidan kan du snabbt och enkelt lägga till inlämningar till nya sidor i din portfolio. Det är bara att klicka på inlämningen du vill lägga till så visas en dialogruta."
        body2: "Toppen! För att lägga till inlämningen, måste du slutligen välja vilken sektion du vill lägga till den i och sedan ge sidan ett namn. När du klickat på ”Lägg till sida” tas du till den nya sidan så att du kan redigera den ytterligare om du vill."
