  if_this_permission_is_disabled_at_the_account_leve_39648abb: "Om den här behörigheten är inaktiverad på kontonivå kan inte användare visa befintliga kontogrupper. På kursnivå kan användare se, men inte öppna, befintliga grupper, inklusive grupper som skapats av studenter. Även Användare – visa lista måste vara aktiverat för att visa grupper. För att lägga till grupper på kontonivå via CSV måste även SIS-data – importera vara aktiverat."
  if_this_permission_is_disabled_at_the_account_leve_6a82182d: "Om den här behörigheten är inaktiverad på kontonivå kan inte användare visa befintliga kontogrupper. På kursnivå kan användare se, men inte öppna, befintliga grupper, inklusive grupper som skapats av studenter. För att visa grupper måste även Användare – visa lista aktiveras. För att lägga till grupper på kontonivå via CSV måste även SIS-data – importera aktiveras."
  if_this_permission_is_disabled_at_the_account_leve_b5f6dfa4: "Om den här behörigheten är avaktiverad på kontonivå kan inte användaren visa befintliga kontogrupper. På kursnivå kan användaren visa men saknar åtkomst till befintliga grupper, däribland grupper som skapats av studenter. För att visa grupper måste även Användare – visa lista aktiveras. För att lägga till grupper på kontonivå via CSV måste även SIS-data – importera aktiveras."
  if_this_permission_is_disabled_the_user_can_only_v_75dbf069: "Om den här behörigheten är avaktiverad kan användaren endast visa befintliga grupper, däribland grupper som skapats av studenter."
  if_this_permission_is_disabled_users_can_only_view_b68143d5: "Om den här behörigheten är inaktiverad kan användare endast se befintliga grupper, inklusive grupper som skapats av studenter."
  if_this_permission_is_disabled_users_can_still_cre_76a2d4b8: "Även om den här behörigheten är inaktiverad kan användare fortfarande skapa eller lägga till uppgiftsmatriser om Uppgifter och quiz – lägg till/redigera/ta bort är aktiverat."
  if_this_permission_is_disabled_users_can_still_ins_4e3cef83: "Även om den här behörigheten är inaktiverad, kan användare ändå installera godkända appar via Canvas appcenter (om aktiverad för din institution). Om den här behörigheten är inaktiverad kan användare dessutom inte ta bort manuellt tillagda externa appar."
  if_this_permission_is_enabled_and_courses_view_lis_cdf22691: "Om den här behörigheten är aktiverad och Kurser – visa lista är inaktiverat, kan användare lägga till en ny kurs med knappen Lägg till en ny kurs i Kontoinställningar."
  if_this_permission_is_enabled_users_do_not_need_th_49974dc2: "Om den här behörigheten är aktiverad behöver inte användare aktivera SIS-data-läsbehörighet. Kontobehörigheten åsidosätter kursbehörigheten. För att förhindra läsare att hantera SIS-ID:n på kursnivå måste även SIS-Data – hantera samt SIS-Data – läs aktiveras. För att lägga till användare till kurser via SIS-ID måste även Användare – lägg till/ta bort studenter från kurser och/eller Användare – lägg till/ta bort lärare, kursdesigners eller TA:er från kurser aktiveras."
  if_this_permission_is_enabled_users_do_not_need_th_e3d0f334: |-
      Om den här behörigheten är aktiverad behöver inte användare ha alternativet SIS-data – läsbehörighet aktiverat. Kontobehörigheten åsidosätter kursbehörigheten. För att hindra användare från att hantera SIS-ID:n på kursnivå måste du inaktivera både SIS-data – hantera och SIS-data – läsa.
