    grade_export: 
      description: "Export av omdöme till SIS"
      name: "Export av omdöme"
    grade_export_settings: 
      description: |-
          Denna plugin möjliggör publicering av slutbedömningar i ett studentinformationssystem (SIS).  Om aktiverat har användaren möjlighet att publicera bedömningarna i bedömningsöversikten.  Detta sker via POST-begäran till den angivna publiceringsslutpunkten.  Varje typ definierar sitt eget innehållsformat och mime-typ.  Slutpunktens svar har ingen betydelse och ignoreras för tillfället.
          
          T.ex. Instructure-formaterad CSV publicerar en CSV-fil med mime-typen 'text/csv' till den angivna slutpunkten, med följande kolumner: 
          
          "publisher_id", "publisher_sis_id", "course_id", "course_sis_id", "section_id", "section_sis_id", "student_id", "student_sis_id", "enrollment_id", "enrollment_status", "score", "grade"
          
          (Obs! Kolumnen "grade" visas endast om kursen anger en bedömningsstandard)
          
          För varje student i kursen som publiceras finns det minst en rad in den publicerade CSV:n. Det finns 1 rad för varje inloggning som studenten har i kursens rotkonto.  Oftast innebär detta 1 rad per student, men om studenten har flera inloggningar finns det en rad för varje inloggning.
          
          Om ”Inkludera åsidosättning av slutbedömning” har markerats, så aktiveras funktionen Åsidosätt slutbedömning och studenter med åsidosätt bedömning/resultat får det i stället för beräknat resultat och bedömning.
      labels: 
        format_type: "Resultatets formattyp"
        include_final_grade_overrides: "Inkludera åsidosättningar av slutbedömning"
        publish_endpoint: "Slutpunkt att publicera till"
        success_timeout: "Tiden gick ut för meddelande om slutfört (i sekunder)"
        wait_for_success: "Vänta på meddelande om slutfört"
