  to_view_the_list_of_users_in_the_course_users_view_c44bdef0: "För att visa listan över användare i kursen måste även Användare – visa lista aktiveras. För att hantera SIS-ID måste SIS-Data – läsa aktiveras. För att redigera en lärares eller en TA:s avsnitt måste även Användare – visa lista och Konversationer – skicka meddelanden till enskilda kursdeltagare aktiverase. För att länka en observatör till en students måste även Konversationer – skicka meddelanden till enskilda kursdeltagare aktiveras."
  to_view_the_list_of_users_in_the_course_users_view_f5a54b37: |
      För att visa en lista över användare i kursen måste Användare – visa lista vara aktiverat.
      SIS-data – läsa måste vara aktiverat för att visa SIS-ID:n. För att lägga till en användare med hjälp av SIS-ID:n måste även SIS-data – hantera vara aktiverat.
      För att redigera en students sektion och kursroll måste även Användare – visa lista och Konversationer – skicka meddelanden till enskilda kursdeltagare vara aktiverade.
      För att avregistrera användare på sidan med användarinformation måste även Visa lista över kurser och Se listan över användare vara aktiverade.
      Gör det möjligt för användaren att skicka om kursinbjudningar från sidan Personer i kursen.
      Om kontoinställningen Öppen registrering är aktiverad kan användare med den här behörigheten lägga till studenter i en kurs från sidan Personer i kurser med hjälp av e-postadresser om användaren inte har något Canvas-konto ännu.
      För att länka en observatör till en student måste även Användare – hantera inloggningsuppgifter och Konversationer – skicka till enskilda kursdeltagare vara aktiverade.
